import React from "react";
import mascote3 from "../img/macaco-caolho-mascote3.png";
import GoogleFontLoader from "react-google-font-loader";

const Header = (props) => {
  return (
    <div>
      <GoogleFontLoader
        fonts={[
          {
            font: "Press Start 2P",
          },
          {
            font: "Fredericka the Great",
          },
        ]}
      />

      <div className="welcome">
        <h1 id="welcome">Macaco Caolho</h1>
        <h1 id="rock">Rock n' Drinks</h1>
      </div>

      <div class="container-sm" id="imgMacaco">
        <img src={mascote3} />
      </div>
    </div>
  );
};

export default Header;
